import { Link } from 'react-router-dom';

const color = {
    color: 'black',
    backgroundColor:'red'

};
class Dashboard extends Component {
	render() {
		return (
			<div id="main">
				<div id="content">
					<section>
						<div className="container">
							<h3>Dashboard</h3>

						</div>
					</section>
				</div>
			</div>
		);
	}
}

export default Dashboard;
